import React from 'react'
import { useDispatch, useSelector  } from 'react-redux';
import {Container,Row,Col} from 'react-bootstrap'

function MyOrder() {
    const order = useSelector(state => state.myorder)
    let content =null
    if(order.length === 0 ){
        content=  <div>
        You have {order.length} items in the basket. <hr />
      </div>
    } 
    if(order.length > 0)
    {
        content=order.map((product,key)=>
        <div key={key}>
        <Col className="each-product"><CartItemCard product={product}/></Col>
        </div>)
    }
    return (
        <div>
            <div className="cart-items">
        <h2>MY GOLOCAL ORDERS({order.length})</h2>
          <Container className="products-container" >
          <Row xs={1} md={1}>
          {content}
          </Row>
        </Container>
        </div>
        </div>
    )
}

export default MyOrder
